Remove multiple objects from deeply nested array 2<p>I need to remove some inconsistent objects not having did,dst and den  from deeply nested array , please, advice if this can be done with single update query for all documents in the collection ?</p>
<p>This is example of my original document:</p>
<pre><code>[
 {
  &quot;_id&quot;: ObjectId(&quot;5c05984246a0201286d4b57a&quot;),
 f: &quot;x&quot;,
 &quot;_a&quot;: [
 {
   &quot;_onlineStore&quot;: {}
 },
 {
 &quot;_p&quot;: {
  &quot;s&quot;: {
    &quot;a&quot;: {
      &quot;t&quot;: [
        {
          id: 1,
          &quot;dateP&quot;: &quot;20200-09-20&quot;,
          did: &quot;x&quot;,
          dst: &quot;y&quot;,
          den: &quot;z&quot;
        },
        {
          id: 2,
          &quot;dateP&quot;: &quot;20200-09-20&quot;
        }
      ]
    },
    &quot;c&quot;: {
      &quot;t&quot;: [
        {
          id: 3,
          &quot;dateP&quot;: &quot;20300-09-22&quot;,

        },
        {
          id: 4,
          &quot;dateP&quot;: &quot;20300-09-23&quot;,
          did: &quot;x&quot;,
          dst: &quot;y&quot;,
          den: &quot;z&quot;
        },
        {
          id: 5,
          &quot;dateP&quot;: &quot;20300-09-23&quot;,

        }
      ]
    }
  }
 }
}
]
}
]
</code></pre>
<p>After the update , the document need to look as follow:</p>
<pre><code> [
 {
  &quot;_id&quot;: ObjectId(&quot;5c05984246a0201286d4b57a&quot;),
  f: &quot;x&quot;,
  &quot;_a&quot;: [
  {
  &quot;_onlineStore&quot;: {}
 },
 {
 &quot;_p&quot;: {
  &quot;s&quot;: {
    &quot;a&quot;: {
      &quot;t&quot;: [
        {
          id: 1,
          &quot;dateP&quot;: &quot;20200-09-20&quot;,
          did: &quot;x&quot;,
          dst: &quot;y&quot;,
          den: &quot;z&quot;
        }
      ]
    },
    &quot;c&quot;: {
      &quot;t&quot;: [
        {
          id: 4,
          &quot;dateP&quot;: &quot;20300-09-23&quot;,
          did: &quot;x&quot;,
          dst: &quot;y&quot;,
          den: &quot;z&quot;
        }
      ]
    }
  }
 }
}
]
}
]
</code></pre>
<p>Please, note a.t , c.t and d.t are all possible objects inside s object , but they are not compulsory in all documents so in some documents they can be missing , in other documents there can be only a.t and c.t ,but not d.t ...</p>
<p>@nimrod serok helped with a partial solution here:</p>
<p><a href="https://stackoverflow.com/questions/74308859/remove-multiple-elements-from-deep-nested-array-with-single-update-query/74309316#74309316">Remove multiple elements from deep nested array with single update query</a></p>
<p>, but there is a small drawback , missing a,c, or d objects in original document do not need to appear in the resulting document as null since they do not exist and not expected:</p>
<p><a href="https://mongoplayground.net/p/HbWFOdlTPwv" rel="nofollow noreferrer">playground</a></p>
<p>( d.t:null and c.t:null shall not appear after the update )</p>

