Method try_next cannot be called on mongodb::Cursor<> due to unsatisfied trait bounds<p>I am loading data from mongodb to my data models and everything was working fine, until I added Vec&lt;Rc&gt; fields to my model (and marked as ignore for Serde).</p>
<p>Here is my model:</p>
<pre><code>#[derive(Debug, Serialize, Deserialize)]
pub struct Relation {
    #[serde(rename = &quot;_id&quot;)]
    pub id: oid::ObjectId,
//  ....
}

#[derive(Debug, Serialize, Deserialize)]
pub struct Item {
    #[serde(rename = &quot;_id&quot;)]
    pub id: oid::ObjectId,
    pub project_id: oid::ObjectId,

    #[serde(skip)]
    pub out_relations: Vec&lt;Rc&lt;Relation&gt;&gt;,
    #[serde(skip)]
    pub in_relations: Vec&lt;Rc&lt;Relation&gt;&gt;,
}
</code></pre>
<p>And here I am reading items from db:</p>
<pre><code>//some db init code
let items = db.collection::&lt;Item&gt;(&quot;items&quot;);
let mut cursor = items.find(Some(doc! { &quot;project_id&quot;: pid }), None).await?;
while let Some(item) = cursor.try_next().await? {
  item_map.insert(item.id, item);
}
</code></pre>
<p>So once I switched to use Rc in vectors (before it was simply vectors of ObjectId and it was ok)
compiler started complaining:</p>
<pre><code>try_next().await? {
^^^^^^^^ method cannot be called on `mongodb::Cursor&lt;Item&gt;` due to unsatisfied trait bounds
</code></pre>
<p>And as a secondary error (see also) it points to mongodb macro implementation:</p>
<pre><code>pub struct Cursor&lt;T&gt; {
   | --------------------
   | |
   | doesn't satisfy `mongodb::Cursor&lt;Item&gt;: TryStreamExt`
   | doesn't satisfy `mongodb::Cursor&lt;Item&gt;: TryStream`
</code></pre>
<p>Is it like Rc doesn't implement streaming and ignoring these fields for serde is not considered on compile time? Any idea how to workaround?</p>

